member.returns:
A 32-bit signed integer indicating the relationship between the two comparands:
            Less than zero: key1 preceeds key2 in the sort order;
            Zero: key1 is equal to key2;
            Greater than zero: key1 follows key2 int he sort order

member.summary:
This function create a new type implementing  interface for the specified number of dimensions.
The resulted class will look like following (for dimensionsCount = 2):
public sealed class TimeSeriesKey2 : TimeSeriesKeyBase
{
    private string dimensionValue0;
    private string dimensionValue1;

    public override void Initialize(TimeSeriesMetadata metadata, IReadOnlyList{string} dimensionValues)
    {
        base.Initialize(metadata, dimensionValues);
        this.dimensionValue0 = dimensionValues[0];
        this.dimensionValue1 = dimensionValues[1];
    }

    public override string GetDimensionValue(int index)
    {
        switch(index)
        {
            case 0: return this.dimensionValue0;
            case 1: return this.dimensionValue1;
        }
    }

    protected override bool AllValuesAreEqual(ITimeSeriesKey other)
    {
        var comparand = other as TimeSeriesKey2;
        if (comparand == null) return false;
        if (!this.dimensionValue0.Equals(comparand.dimensionValue0, StringComparison.OrdinalIgnoreCase) return false;
        if (!this.dimensionValue1.Equals(comparand.dimensionValue1, StringComparison.OrdinalIgnoreCase) return false;
        return true;
    }
}
